import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMoon, faSun } from "@fortawesome/free-solid-svg-icons";

const Logo = ({setDarkMode}) => {


  return (
  <div className="not-fancy-font flex flex-col ml-5 mt-8 max-w-700 max-h-800 !overflow-hidden">
    <div className="flex items-center">
      <div className="text-white text-40 font-light tracking-12">NEEK</div>
      <div className="flex gap-5 right-5 fixed">
       <button onClick={()=> setDarkMode(false)} className="border-none bg-transparent"> <FontAwesomeIcon icon={faMoon} className="text-white text-x-large"/></button>
        <FontAwesomeIcon icon={faSun} className="text-white text-x-large"  onClick={()=> setDarkMode(true)}/>
      </div>
    </div>
    <div className="flex gap-3">
      <div className="bg-white h-2 w-115 border-white mt-2" />
      <div className="text-white text-16">Software Engineer / Artist</div>
    </div>
  </div>
)};

export default Logo;
